import React from 'react';
import {Route, Switch} from 'react-router-dom';
import Login from './Components/login';
import Home from './Components/home';
import './App.css';

function App() {
  return (
    <div>
      <Switch>
      <Route path='/' Component={Login}/>
      <Route path='/home' Component={Home}/>
      </Switch>

    </div>
  );
}

export default App;
